import React from "react";
import { useResumeDataContext } from "../Providers/ResumeDataProvider";
import { FaBriefcase } from 'react-icons/fa';

const Experience = () => {
    const { resumeData } = useResumeDataContext();

    var message = Object.values(resumeData[0].experience[0]).map((experience, index) => (
        <div key={index} className="items-center mb-5 p-5  bg-[rgba(0,0,0,0.45)] backdrop-blur border-black rounded-3xl shadow-lg">
            <div className='flex items-center'>
                <FaBriefcase className="text-2xl mr-4" />
                <h1 className="text-xl font-semibold">{experience[0].position}</h1>
            </div>
            <div className='pl-12'>
                <p className="text-lg mb-2">{experience[0].company}</p>
                <p>
                    {experience[0].startDate} - {experience[0].endDate}
                </p>
            </div>
        </div>
    ));

    return (
        <div className="tab-contents active-tab">
            <div>
                {message}
            </div>
        </div>
    );
}

export default Experience;
